package 加密解密;

import common.utils.Base64Util;

import java.io.File;
import java.io.FileOutputStream;
import java.util.Base64;

/**
 * <p>Description: </p>
 * <p>@date 2022/3/24 10:51</p>
 *
 * @author cuiyy
 * @version v1.0.0
 **/
public class Test1 {
    public static void main(String[] args) {

        try {

            String imgStr = "data:image/png;base64,";
//            String imgStr = "data:image/png;base64,%E2%80%A6";
            String base64Data = imgStr.split(",")[1];

            base64Data = Base64Util.decodeToString(base64Data);


            Base64.Decoder decoder = Base64.getDecoder();
            byte[] bytes = decoder.decode(base64Data);
            File file2 = new File("temp.jpg");
            FileOutputStream fos = new FileOutputStream(file2);
            fos.write(bytes);
            System.out.println(file2.getAbsolutePath());
        } catch (Exception e) {
            System.out.println(e.getMessage());
        }

    }
}
